import React, { useState, useEffect } from 'react';
import Feed from './components/Feed';



function App() {
    const [isfeed, setIsfeed] = useState([])

    useEffect(() => {
        fetch("http://localhost:5000/", {
            'method': 'GET',
            headers: {
                'Content-Type': 'application/json'
            }
        })
            .then(res => res.json())
            .then(isfeed => {
                setIsfeed(isfeed)
                console.log(isfeed)
                })
    }, [])

    return (
        <div>
        {(isfeed.current_session === false) ? (
            <p>No session present</p>
        ) : (
            <Feed/>
        )}
        </div>
    )
}

export default App
